import React, { Component, useState } from 'react';
import './App.css';

const App = () => {

  const [tp_founder_eo_value, tp_founder_eo_setValue] = useState("И.О.Фамилия");
  const [tp_fullname_eo_value, tp_fullname_eo_setValue] = useState("");
  const [tp_shortname_eo_value, tp_shortname_eo_setValue] = useState("");
  const [tp_expert_advisory_org_value, tp_expert_advisory_org_setValue] = useState("НМС");
  const [tp_protocol_number_value, tp_protocol_number_setValue] = useState("");
  const [tp_meeting_date_smc_value, tp_meeting_date_smc_setValue] = useState("дд.мм.гггг");
  const [tp_date_approval_program_value, tp_date_approval_program_setValue] = useState("дд.мм.гггг");
  const [tp_surname_head_eo_value, tp_surname_head_eo_setValue] = useState("И.О.Фамилия");
  const [tp_program_name_value, tp_program_name_setValue] = useState("");
  const [tp_direction_value, tp_direction_setValue] = useState("Направление");
  const [tp_addressee_program_value, tp_addressee_program_setValue] = useState("");
  const [tp_implementation_period_value, tp_implementation_period_setValue] = useState("");
  const [tp_program_volume_value, tp_program_volume_setValue] = useState("");
  const [tp_implementation_place_value, tp_implementation_place_setValue] = useState("");
  const [tp_approval_year_value, tp_approval_year_setValue] = useState("Направление");
  const [tp_surname_originator_value, tp_surname_originator_setValue] = useState("И.О.Фамилия");


  return (
    <div className="App">
      <div className='Title List'>
        <label>Учредитель образовательной организации</label><br/>
        <input value={tp_founder_eo_value} onChange={(e) => tp_founder_eo_setValue(e.target.value)}/><br/>
        <label>Полное название образовательной организации (по уставу)</label><br/>
        <input value={tp_fullname_eo_value} onChange={(e) => tp_fullname_eo_setValue(e.target.value)}/><br/>
        <label>Сокращенное название образовательной организации (по уставу)</label><br/>
        <input value={tp_shortname_eo_value} onChange={(e) => tp_shortname_eo_setValue(e.target.value)}/><br/>
        <label>Рассмотрено на </label>
        <select value={tp_expert_advisory_org_value} onChange={(e) => {tp_expert_advisory_org_setValue(e.target.value);}}>
          <option value="НМС">НМС</option>
          <option value="ПС">ПС</option>
        </select><br/>
        <label>№ протокола</label><br/>
        <input value={tp_protocol_number_value} onChange={(e) => tp_protocol_number_setValue(e.target.value)}/><br/>
        <label>Дата заседания НМС, ПС</label><br/>
        <input value={tp_meeting_date_smc_value} onChange={(e) => tp_meeting_date_smc_setValue(e.target.value)}/><br/>
        <label>Дата утвердения программы руководителем (в соответствии с приказом образовательной организации реализующей программу)</label><br/>
        <input value={tp_date_approval_program_value} onChange={(e) => tp_date_approval_program_setValue(e.target.value)}/><br/>
        <label>Должность,фамилия, иннициалы руководителя образовательной организации</label><br/>
        <input value={tp_surname_head_eo_value} onChange={(e) => tp_surname_head_eo_setValue(e.target.value)}/><br/>
        <label>Дополнительная общеобразовательная общеразвивающая программа (укажите название)</label><br/>
        <input value={tp_program_name_value} onChange={(e) => tp_program_name_setValue(e.target.value)}/><br/>
        <label>Направленность</label><br/>
        <select value={tp_direction_value} onChange={(e) => {tp_direction_setValue(e.target.value);}}>
          <option value="Техническая">Техническая</option>
          <option value="Естественнонаучная">Естественнонаучная</option>
          <option value="Художественная">Художественная</option>
          <option value="Туристско-краеведческая">Туристско-краеведческая</option>
          <option value="Физкультурно-спортивная">Физкультурно-спортивная</option>
        </select><br/>
        <label>Адресат программы (возраст в границах  от 6 до 18 лет)</label><br/>
        <input value={tp_addressee_program_value} onChange={(e) => tp_addressee_program_setValue(e.target.value)}/><br/>
        <label>Срок реализации программы (в годах, месяцах)</label><br/>
        <input value={tp_implementation_period_value} onChange={(e) => tp_implementation_period_setValue(e.target.value)}/><br/>
        <label>Объем программы в часах</label><br/>
        <input value={tp_program_volume_value} onChange={(e) => tp_program_volume_setValue(e.target.value)}/><br/>
        <label>Место реализации программы (город, поселок)</label><br/>
        <input value={tp_implementation_place_value} onChange={(e) => tp_implementation_place_setValue(e.target.value)}/><br/>
        <label>Год утверждения программы (программы утверждаются ежегодно перед началом реализации)</label><br/>
        <select value={tp_approval_year_value} onChange={(e) => {tp_approval_year_setValue(e.target.value);}}>
          <option value="2022">2022</option>
          <option value="2023">2023</option>
          <option value="2024">2024</option>
          <option value="2025">2025</option>
          <option value="2026">2026</option>
        </select><br/>
        <label>Фамилия, иннициалы, должность составителя программы. Например, Иванов С.И., педагог дополнительного образования</label><br/>
        <input value={tp_surname_originator_value} onChange={(e) => tp_surname_originator_setValue(e.target.value)}/><br/>
      </div>
      <div className='Title List'>

      </div>
    </div>
  );
}

export default App;
